import React from "react";
import ReactDOM from "react-dom"
import backgroundsvg from "./purpleGradient.svg"
import Button from "./button";
const App = () =>{
    return( <div className="ui container" style={{ 
        backgroundImage: `url(${process.env.PUBLIC_URL + '/purpleGradient.svg'})` 
      }}>
        <Button/>
    </div>);
};

export default App;
